import React,{useState,useEffect} from 'react'
import axios from 'axios'

const App = () => {
const [form,setform]=useState({name:'',fatherName:'',mobileNumber:''})
const[data,setData]=useState([])
//const [edit,setEdit]=useState(null)

const API_URL='http://localhost:4000/'

const handleSubmit=(e)=>{
e.preventDefault()
setData([...data,form]);
axios.post(API_URL+'save',form)
}

useEffect(()=>{

const showData=async()=>{
const res=await axios.get(API_URL+'fetchData')
setData(res.data); 
console.log(res.data)
}
showData()
},[])



const handleChange=(e)=>{
  setform({...form,[e.target.name]:e.target.value})
}

const handleDelete=async(id)=>{
await axios.delete(`${API_URL}delete/${id}`)
setData(data.filter((item)=>item._id!==id)); 
}

const handleEdit=async(id)=>{
const res=await axios.put(`${API_URL}edit/${id}`,form)
const up=data.map((item)=>item._id==id?res.data:item)
setData(up); 
}

const handleFill=(item)=>{
setform({
  name:item.name,
  fatherName:item.fatherName,
  mobileNumber:item.mobileNumber
})




  return (
  <div style={{ textAlign: 'center' }}>
    <form onSubmit={handleSubmit}>
      Name: <input type="text" placeholder="Enter The Name" onChange={handleChange} name="name" value={form.name} /><br />
      Father Name: <input type="text" placeholder="Enter The Father Name" onChange={handleChange} name="fatherName" value={form.fatherName} /><br />
      Mobile Number: <input type="text" placeholder="Enter The Mobile Number" onChange={handleChange} name="mobileNumber" value={form.mobileNumber} /><br />
      <button type="submit">Submit</button>
    </form>

    <h1>Display Detail</h1>
    <hr />
    <center>
      <table border="1" width="600px" cellSpacing="0">
        <thead>
          <tr>
            <th>Name</th>
            <th>Father Name</th>
            <th>Mobile Number</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {data.map((item) => (
            <tr key={item._id}>
              <td>{item.name}</td>
              <td>{item.fatherName}</td>
              <td>{item.mobileNumber}</td>
              <td><button type="button" onClick={() => handleDelete(item._id)}>Delete</button>
             <button type="button" onClick={() => handleEdit(item._id)} style={{gap:'2px'}} onClick={() => handleFill(item)}>Edit</button ></td>
            </tr>
          ))}
        </tbody>
      </table>
    </center>
  </div>
);
}
}
export default App
